            <img src="https://media.giphy.com/media/A5ugHVbuFL3uo/giphy.gif"></img>
            <h3>404 - page not found</h3>
            <p>We couldn't find the page you were looking for. The link to this page may be incorrect or out of date.</p>
            <NavLink to="/"><button className="btn waves-effect waves-teal pink">Home</button></NavLink>

        </article>
    )
}
